import style from './about.module.css';
import img from '../../img/banner.gif';

export default function About() {

  return (
    <div className={style.datos}>
      <h1>Hola!!! Mi nombre el Lucy y este es mi primer proyecto desarrollado
        con React, Redux, Express y Sequelize; emocionada de poder compartir 
        este primer logro que es el punto de partida para otros proyectos.
      </h1>
      <img src={img} alt="img" />
            
    </div>
  );
}
